import React from 'react'
import styled from 'styled-components'

const Signin = () => {
    return (
        <Body><div className='login_container'>



<div className='wp'>  <h><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ashberry</h>

<r><br/><br/><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Welcome to ashberry</r>
<m><br/><br/><br/><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-here u can make your friends  with here highly complatabal  <br/><br/><br/><br/>
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-meet with same  nature parter as your nature</m></div>

<div className='si'><h2>dsfsdf</h2></div>


</div>


        </Body>
      

    )
}

const Body = styled.nav`


   background-image: url("https://webgradients.com/public/webgradients_png/002%20Night%20Fade.png"); 
   height:1321px;width:1349px;

h{
    font-size:54px;
    color:rgba(223,87,87,255);
}
r{
    color:white;
    font-size:44px;
}


.login_container{
    max-width: 1540px;
    height:500px;

    display:flex;
    align-items:center;
    justify-content: center;
    margin:0 auto;
    
}


.si{
    background-color:gray;
    height:60vh;
    width:34vh;
    display:flex;
    flex-direction:column;
    align-items:certer;
    padding-left:43px
}
.wp{
    
margin-right:534px


    
  

}
`

export default Signin
